import React from "react";
import ReactDOM from "react-dom";
// import "./index.css";
// import App from "./App";
import Card from "./Card";
import SData from "./SData";

ReactDOM.render(
  <>
    <h1>List of top 5 netflix series</h1>,
    <Card
      imgsrc={SData[0].imgscr}
      title={SData[0].title}
      sname={SData[0].sname}
      link={SData[0].link}
    />
    <Card
      imgsrc={SData[1].imgscr}
      title={SData[1].title}
      sname={SData[1].sname}
      link={SData[1].link}
    />
    <Card
      imgsrc={SData[2].imgscr}
      title={SData[2].title}
      sname={SData[2].sname}
      link={SData[2].link}
    />
  </>,
  document.getElementById("root")
);
